import React from 'react';
import { Link } from 'react-router-dom';

function Homepage() {
  return (
    <div>
      <h1>Homepage</h1>
      <section>
        <h2>About</h2>
        <p>This is a quiz application.</p>
      </section>
      <section>
        <Link to="/quiz">Attempt Quiz</Link>
      </section>
      <section>
        <Link to="/profile">Profile Section</Link>
      </section>
    </div>
  );
}

export default Homepage;
